import React from 'react';
import UserList from './UserList';

function Bloger() {
  const users = [
    {
      name: 'Danial',
      surname: 'Abibulla',
      password: 'password1',
      phonenumber: '871234567',
      avatarUrl: '/img/logo.jpeg',
      
      group: 'IT2-2114'
    },
    {
      name: 'Batyrkhan',
      surname: 'Rukhanov',
      password: 'password2',
      phonenumber: '88712345678',
      avatarUrl: '/img/logo.jpeg',
      group: 'IT2-2114'
    },
    {
      name: 'Adilbek',
      surname: 'Adilzhan',
      password: 'password3',
      phonenumber: '887123456789',
      avatarUrl: '/img/logo.jpeg',
      group: 'IT2-2114'
    },
    {
      name: 'Batyrkhan',
      surname: 'Otynchiev',
      password: 'password4',
      phonenumber: '88712345689',
      avatarUrl: '/img/logo.jpeg',
      group: 'IT2-2114'
    },
  ];

  return (
    <>
      <div className="bloger">
        <div className="info">
          <img src="/img/logo.jpeg" alt="Blogger Avatar" />
          <div className="about">
            <h4 className="fullname">{`${users[0].name} ${users[0].surname}`}</h4>
            <p>{users[0].about}</p>
          </div>
        </div>
        <button className="delete-bloger">
          <img src="/img/delete.png" alt="Delete Blogger" />
        </button>
      </div>
      <div className="app">
        <UserList users={users} />
      </div>
    </>
  );
}

export default Bloger;
